},{"footer":["21",{}],"main":["1",{"display":{v:"00000017"},"frameName":{v:"content"}}],"menu":["2",{}],"nav":["23",{}]},{}],"21":[function(webMI,window,document,self){webMI.trigger.connect("SetFooterConfig", function(e){

